import React from "react";
import { useNavigate } from "react-router-dom";

const UserTable = ({ users, onDelete, onSort }) => {
  const navigate = useNavigate();

  return (
    <table className="table table-striped table-hover shadow-sm rounded">
      <thead className="table-dark">
        <tr>
          <th onClick={() => onSort("id")} style={{ cursor: "pointer" }}>ID</th>
          <th onClick={() => onSort("firstName")} style={{ cursor: "pointer" }}>First Name</th>
          <th onClick={() => onSort("lastName")} style={{ cursor: "pointer" }}>Last Name</th>
          <th onClick={() => onSort("email")} style={{ cursor: "pointer" }}>Email</th>
          <th onClick={() => onSort("department")} style={{ cursor: "pointer" }}>Department</th>
          <th>Actions</th>
        </tr>
      </thead>
      <tbody>
        {users.map((user) => {
          const [firstName, lastName] = user.name.split(" ");
          return (
            <tr key={user.id}>
              <td>{user.id}</td>
              <td>{firstName}</td>
              <td>{lastName || ""}</td>
              <td>{user.email}</td>
              <td>{user.department}</td>
              <td>
                <button
                  className="btn btn-sm btn-primary me-2"
                  onClick={() => navigate(`/edit/${user.id}`)}
                >
                  Edit
                </button>
                <button
                  className="btn btn-sm btn-danger"
                  onClick={() => onDelete(user.id)}
                >
                  Delete
                </button>
              </td>
            </tr>
          );
        })}
      </tbody>
    </table>
  );
};

export default UserTable;



